import styled from "styled-components";
import { Amazon_Logo } from "../assets/Images";

const Header = () => {
  return (
    <HeaderContainer>
      <nav className="TopNav flex">
        <div className="TopNav__left">
          <img src={Amazon_Logo} alt="" className="TopNav__left__img" />
        </div>
        <div className="TopNav__middle"></div>
        <div className="TopNav__right"></div>
      </nav>
      <nav className="BottomNav"></nav>
    </HeaderContainer>
  );
};

export default Header;

const HeaderContainer = styled.header`
  width: 100%;
  height: 4rem;
  color: white;
  padding: 1rem;
  background-color: rgba(0,0,0,.9);

  .TopNav {
    align-items: center;
    .TopNav__left__img {
      width: 8.5rem;
      height: 2.8rem;
    }
  }
`;
